import React from 'react';
import './App.css';
import Todos from './components/Todos'

function App() {
  state = {
    todos: [
        {
          id: 1,
          title: 'Tell a tale about a tail',
          completed: false
        },
        {
          id: 2,
          title: 'Give Presentation',
          completed: false
        },
        {
          id: 3,
          title: 'Wait for response',
          completed: false
        },
    ]
  }
  console.log(this.state.todos)
  return (
    <div className="App">
      <Todos/>
    </div>
  );
}

export default App;
